(16, 'Ao colher, em fontes diversas e muito dispersas, informações, testemunhos e estudos sobre o livro e as bibliotecas no Brasil colonial, Antônio de Sousa Macedo (1606-1682) nos ofereceu o primeiro trabalho de síntese e sistematização sobre importante e até então pouco estudado aspecto de nossa história cultural. Decorridos mais de 25 anos da publicação desta obra, os estudos sobre história do livro e da leitura conquistaram espaço na academia. E hoje a bibliografia sobre o tema ganhou novas e excelentes contribuições, muitas delas aprofundando o estudo de pontos aqui abordados ou lembrados como merecedores de pesquisas. Em algumas universidades a história do livro, da leitura e das bibliotecas constitui a prioridade de grupos de pesquisa. Além de um congresso nacional voltado para essa temática, ocorrem com freqüência seminários e encontros. Essa realidade, que inexistia na época da publicação de Livros e bibliotecas no Brasil colonial, ressalta a importância desta segunda edição do trabalho pioneiro de Rubens Borba de Moraes, que estava há muito esgotado. Na preparação desta edição, além da óbvia necessidade de reparar algumas falhas de revisão tipográfica, sanou-se a ausência do fac-símile do catálogo de novidades da livraria de Paulo Martin, na edição original. Acrescentou-se um anexo com uma lista de hipóteses de identificação da maioria dos títulos constantes da famosa biblioteca de Manuel Inácio da Silva Alvarenga, que foi adquirida pela Biblioteca Nacional em 1815. Reitera-se o que era afirmado na primeira edição, e que o tempo confirmou uma obra básica para universitários, pesquisadores e estudiosos, em geral .', '2020-03-22 02:26:17', 1, '8f2433bd05a2ac60c7e590632549c163', 'pt_BR'),
