(44, 'A escola não pode mais contentar-se em ser apenas transmissora de conhecimentos que, provavelmente, estarão defasados antes mesmo que o aluno termine sua educação formal; tem de promover oportunidades de aprendizagem que dêem ao estudante condições de aprender a aprender, permitindo-lhe educar-se durante a vida inteira. A biblioteca está presente nesse processo. Trabalhando em conjunto, professores e bibliotecários planejarão situações de aprendizado que desafiem e motivem os alunos, acompanhando os seus progressos, orientando-os e guiando-os no desenvolvimento de competências informacionais cada vez mais sofisticadas.', '2020-03-22 02:27:09', 1, 'e26120224d52bd66cca7464ce54c4a0a', 'pt_BR'),
