(1382, 'O livro apresenta abordagens diferentes sobre temas atuais relacionados com o lúdico, oferecendo ao leitor uma visão geral sobre brinquedoteca, desde sua origem até o acervo lúdico atual. Permite aprofundar temas específicos como usos e significações dos jogos e brinquedos, a resiliência, as origens da capacidade simbólica, os jogos tradicionais, a criança e o computador e ainda possibilita conhecer diferentes experiências através dos relatos de brinquedotecas universitárias, hospitalares, comunitárias e escolares, que certamente contribuirão para o aprofundamento do tema.', '2020-05-11 12:33:48', 1, 'b0e6a58abf06d03dab8c1425c9296215', 'pt_BR'),
