(1387, 'Neusa Dias de Macedo', '2020-05-11 12:34:43', 1, '1e2994d0e6e35f401aa5a2dbea7ad284', 'pt'),
(1388, 'ISBN:9788573594249:book:pt', '2020-05-11 12:34:43', 1, 'e5adb11d111d116d13228d35a528b9c1', 'pt_BR'),
