(1390, '446 p.', '2020-05-11 12:34:43', 1, 'c7b762534d456d2a91ddf8eac1437baa', 'pt'),
(1391, 'Dois importantes campos do conhecimento são investigados nesta obra - biblioteconomia e educação. Este livro rastreia - na preservação da memória da experiência profissional e acadêmica de Neusa Dias de Macedo - os últimos cinquenta anos da luta para tornar a biblioteca um verdadeiro organismo informativo-educacional que procura capacitar os usuários e aprendizes na apropriação de princípios e práticas para a busca, uso e avaliação da informação. Este livro é uma contribuição para a área da educação, colaborando para chamar a atenção das instâncias superiores brasileiras para o direito de nossos jovens e crianças (principalmente das camadas mais carentes da população) à assistência e aos serviços bibliotecários.', '2020-05-11 12:34:43', 1, 'c309eb95f5643ad0bcf720a5dce71d11', 'pt_BR'),
