(1546, '´Cultura geral´ aborda episódios centrais da Bíblia; a emergência dos Estados e a epopéia da modernização, revoluções e democracia; a evolução da literatura, da arte e da música por meio de suas grandes obras; o desenvolvimento da ciência e da filosofia, o campo de batalha das ideologias, das cosmogonias e das teorias, aborda também a educação dada pelos livros, colégios e universidades, pelos jornais e foros de opiniões. A obra também inclui um quadro cronológico, uma breve relação dos livros que transformaram o mundo e conselhos de leitura.', '2020-05-11 12:42:23', 1, '6362685bf686458ede6924e08d2bf891', 'pt_BR'),
(1547, 'Uma vida entre livros: reencontros com o tempo', '2020-05-11 12:43:13', 1, '303bed476617f150467e2d93cdb165da', 'pt_BR'),
(1548, 'José E. Mindlin', '2020-05-11 12:43:13', 1, '4ff8cb34caa43518146b045e291be746', 'pt'),
(1549, 'ISBN:9788571647046:book:pt', '2020-05-11 12:43:13', 1, '49e6e117022d6aada170e0cc109eccab', 'pt_BR'),
