(1551, '231 p.', '2020-05-11 12:43:13', 1, 'aea68abcc40f6a1cb8f70bd36c9fdcc1', 'pt'),
(1552, 'No prefácio a Uma vida entre livros, Antonio Candido descreve José Mindlin: \"Indiscriminado e seletivo, glutão e refinado, ele é o tipo ideal de leitor, porque sabe que praticamente nenhuma leitura é perda de tempo se der prazer\". Mindlin já falou em público muitas vezes sobre sua paixão pela leitura e sobre como ela originou uma biblioteca absolutamente sui generis. Agora, partindo de uma entrevista que concedeu em 1990, registra por escrito esse convívio de toda uma vida, num texto em que a despretensão é o primeiro indício de uma experiência consolidada serenamente.', '2020-05-11 12:43:13', 1, 'fc16dce11f1ed5db6266d99e6967526d', 'pt_BR'),
(1553, 'Os jovens e a leitura: uma nova perspectiva', '2020-05-11 12:44:05', 1, 'ddde0ff0bf35008f61725d2e6cd3c9b8', 'pt_BR'),
