(1558, 'Partindo de entrevistas com leitores de bairros marginalizados das grandes cidades francesas, bem como do testemunho de escritores e suas obras, a antropóloga Michèle Petit ilumina por vários ângulos as relações entre os jovens e o livro no mundo globalizado, apostando no papel fundamental que a leitura pode representar para a construção e reconstrução do sujeito, particularmente em contextos de crise e de grande violência social.', '2020-05-11 12:44:06', 1, 'c6cc1b471d94aa5a13dd61c50a70ebe6', 'pt_BR'),
