(1862, 'Considerando que existe um esquema repetido para contar a história do Brasil, o autor propõe rever alguns conceitos sobre o tema como, por exemplo, o ideal do bom selvagem e o massacre da Guerra do Paraguai. A obra está dividida em nove capítulos - Índios, Negros, Escritores, Samba, Guerra do Paraguai, Aleijadinho, Acre, Santos Dumont e Comunistas.', '2020-05-12 23:21:37', 1, 'bd2b73a78d291d188f7c48ab1c742fdb', 'pt_BR'),
