(1868, 'ISBN:9788580412246', '2020-05-12 23:28:20', 1, 'a6df2c208ac804f3d2faf60463ea7120', 'pt_BR'),
(1869, 'Aos 20 anos, Matt Hunter vive uma noite de horror que ficará para sempre gravada em sua memória. Durante uma festa, ao tentar apartar uma briga, ele mata uma pessoa acidentalmente e é considerado culpado pelo júri. Agora, nove anos depois de ser libertado da prisão, tudo parece ter entrado nos eixos; Olivia, sua esposa, está grávida e os dois estão prestes a comprar uma casa na cidade natal dele. Mas a ilusão acaba quando Matt recebe um vídeo chocante e inexplicável que começa a despedaçar sua vida pela segunda vez. Para piorar, ele começa a ser seguido por um homem misterioso. Em pouco tempo, o perseguidor é encontrado morto e uma freira querida por todos também é assassinada. Quando as pistas apontam para Matt, ele e Olivia são forçados a desafiar a lei em uma tentativa desesperada de salvar seu futuro juntos.', '2020-05-12 23:28:20', 1, '830395dc281032a101f277d4263b1362', 'pt_BR'),
