(1875, '304 p.', '2020-09-09 23:25:51', 1, '78b341f296885324fd4004a5beb5505a', 'pt'),
(1876, 'Facilitar a tarefa dos educadores para desenvolver nos alunos habilidades para lidar com a informação. Esta é a proposta de Como usar a biblioteca na escola, livro cujo conteúdo segue os preceitos dos Parâmetros Curriculares Nacionais (PCNs). O educador encontrará uma nova metodologia para preparar as crianças e jovens de 4 a 15 anos – respeitando sempre seus estágios de desenvolvimento – para a prática da pesquisa escolar. Assim, os alunos aproveitarão completamente todas as informações oferecidas pela biblioteca. Baseado na obra da conceituada educadora norte-americana Carol C. Kuhlthau, o livro foi adaptado para a realidade brasileira por um grupo de pesquisadores da Escola de Ciência da Informação da Universidade Federal de Minas Gerais.', '2020-09-09 23:25:51', 1, 'a7a54d37417ab9c9bb0e74e9634dbd55', 'pt_BR'),
(1877, 'Formação humana na escola', '2020-09-09 23:25:51', 1, '8c3e8bb2efa4eb4c9f9e48853401673c', 'pt'),
(1878, 'Inclusao digital', '2020-09-09 23:27:12', 1, 'd5b529a979be5a570860434e05168436', 'pt_BR'),
(1879, 'Edilson Cazeloto', '2020-09-09 23:27:12', 1, 'e14fa4433c114a95deb734b994503a08', 'pt'),
(1880, 'ISBN:9788573597691:book:pt', '2020-09-09 23:27:12', 1, '9cf0f2d934ccb366ee58b19443842fad', 'pt_BR'),
(1881, 'ISBN:9788573597691', '2020-09-09 23:27:12', 1, '0605a7dd3038459d46869bc7332dc160', 'pt_BR'),
(1882, '208 p.', '2020-09-09 23:27:12', 1, 'fd2532e3f89a0e8a34a3d1f3b740b3ce', 'pt'),
(1883, 'É possível ser contra a inclusão digital? Será ela sinônimo de inclusão social? O autor considera que a análise dos Programas Sociais de Inclusão digital, entendidos como formas de expansão da cibercultura, não pode prescindir da reflexão sobre como o poder econômico se excerce e legitima nas sociedades contemporâneas. O autor investiga como os eixos principais da cibercultura (informatização do cotidiano e saturação mediática) se articulam em conformidade com a nova global de soberania.', '2020-09-09 23:27:12', 1, 'f30a0c81ac5540929bc7bda8ac90fbde', 'pt_BR'),
(1884, 'A biblioteca à noite', '2020-09-09 23:28:29', 1, '9d15ba16af3fe7742dd08e690edd7bec', 'pt_BR'),
(1885, 'Samuel Titan Júnior', '2020-09-09 23:28:29', 1, '0bd3a3979d2aefacbd2da475f70990c8', 'pt'),
(1886, 'ISBN:9788535908817:book:pt', '2020-09-09 23:28:29', 1, '5dd9711b52c685f51d602551d2f4a2d5', 'pt_BR'),
(1887, 'ISBN:9788535908817', '2020-09-09 23:28:29', 1, '05a9d28a5470463ed08dc816639da9cc', 'pt_BR'),
(1888, '301 p.', '2020-09-09 23:28:29', 1, '8e36f793eacea45dc96666cbf2665636', 'pt'),
(1889, 'Depois de viver em vários países, Manguel encontra numa aldeia francesa o lugar perfeito para reunir seus livros: um galpão medieval em ruínas anexo à casa paroquial, que adquire e reforma, e onde vive há alguns anos. Aos poucos, a biblioteca toma forma a partir de pedras soltas, caixotes abertos, pilhas de livros, reminiscências e idiossincrasias de seu dono. O dom narrativo de Manguel faz de cada questão prática - qual a forma ideal de um acervo, em que ordem dispor os livros, que obras manter e que obras descartar - o ensejo para passeios eruditos por bibliotecas antigas e modernas, de papel ou de bits, povoadas pelos tipos mais desvairados e cativantes. Nos quinze ensaios de A biblioteca à noite, os valores e sentidos representados no ato de colecionar livros são esmiuçados: afinal, ao longo da história as bibliotecas simbolizaram as aspirações e pesadelos mais díspares da humanidade.', '2020-09-09 23:28:29', 1, '02eb675e2fa8090a6a4569e7293b0b9a', 'pt_BR'),
(1890, 'Cidade digital: infoinclusão social e tecnologia em rede', '2020-09-09 23:28:39', 1, '67fccc70ca94124819004374b5c7268d', 'pt_BR'),
(1891, 'Evandro Prestes Guerreiro', '2020-09-09 23:28:39', 1, 'bea5d1a2664d92b38c0ceffd98029fe8', 'pt'),
(1892, 'ISBN:9788573594607:book:pt', '2020-09-09 23:28:39', 1, '0b2779f8abfd4855b7ad69bec14c0e2b', 'pt_BR'),
(1893, 'ISBN:9788573594607', '2020-09-09 23:28:39', 1, '1bc65e90ab8bc53c6945cc781339637b', 'pt_BR'),
(1894, '352 p.', '2020-09-09 23:28:39', 1, '8bc26f9cb58590cf0f1c8d5d7fafe447', 'pt'),
(1895, 'Infoinclusão social é, segundo o autor, a relação de equilíbrio sustentável entre o progresso tecnológico e o desenvolvimento social das cidades. Em discussão nesse livro estão, além da necessidade urgente da infoinclusão social, a democratização dos meios de comunicação, a conscientização de gestores das cidades e dos cidadãos quanto às mudanças iminentes, e os problemas decorrentes desses processos. O autor discorre, também, sobre o desenvolvimento da cidade digital - uma projeção futurista que, na verdade, já é fato em muitas localidades.', '2020-09-09 23:28:40', 1, '9755e326e9125f518eac59aa71524f1f', 'pt_BR'),
(1896, 'Redes', '2020-09-09 23:28:40', 1, '2a9c31cdb6a758c90485380aaead1130', 'pt'),
