(1905, 'ISBN:9788531408106:book:pt', '2020-09-09 23:28:58', 1, '7f1d12e6a92144e880c7f2efb9e07f4a', 'pt_BR'),
(1906, 'ISBN:9788531408106', '2020-09-09 23:28:59', 1, 'cb3b329420341ca8f3d36a10b4ba9c7b', 'pt_BR'),
(1907, '285 p.', '2020-09-09 23:28:59', 1, 'a54a9c1e34b6d3da3c5ae17b12148fda', 'pt'),
(1908, 'A terminologia, disciplina que estuda as línguas de especialidade e seu vocabulário, tem apresentado grande desenvolvimento nos últimos anos, entretanto, há ausência de bibliografia em língua portuguesa para iniciantes. Este livro apresenta de modo simples os principais modelos teóricos da terminologia e a metodologia padrão de tratamento de dados terminológicos. Seu objetivo é oferecer um instrumento de ensino e aprendizado dos conceitos fundamentais da terminologia e da prática de elaboração de dicionários técnicos e científicos para falantes da língua portuguesa. Destinado a professores e estudantes de diversas áreas, e a tradutores, jornalistas, profissionais de áreas técnicas e científicas em geral, é composto de seis capítulos que se propõem a compendiar a terminologia como disciplina e como atividade. É um livro que sintetiza os conhecimentos básicos sobre a matéria e que oferece uma base segura a todos os iniciantes nessa área.', '2020-09-09 23:28:59', 1, '821d4c3d5527af316d37a8116e271ea0', 'pt_BR'),
