(2165, 'Este \"Kitábu\" representa uma tentativa de sistematização do conhecimento sobre as religiões africanas nas Américas, a partir de suas matrizes. Realizando uma espécie de arqueologia das raízes históricas e mitológicas dessas religiões, Nei Lopes debruça-se sobre esse conjunto de crenças e cultos, com recomendou Marcel Griaule, em 1950, para trazer a público \"uma estrutura religiosa firme e digna\". E isso, por meio de uma espécie de breviário, abordando o continuum que se estabelece entre as antigas civilizações africanas, sua espiritualidade e seu saber, e os povos construtores da Afro-América.', '2020-12-18 19:14:59', 1, '7968a10adc9c3096d94330f8925149e8', 'pt_BR'),
(2166, 'Visões da liberdade: uma história das últimas décadas da escravidão na corte', '2020-12-18 19:30:32', 1, '37094ee4c8f002e586644949b498905b', 'pt_BR'),
