(2171, 'Rio de Janeiro, últimas décadas do século XIX. Adão Africano, Genuíno, Juvêncio, Bonifácio, Francelina, Maria de São Pedro - todos negros, vários escravos - esses são alguns dos personagens que protagonizam este livro. Baseando-se em pesquisas, o autor procura analisar os processos criminais e de obtenção de alforria em que esses negros estavam envolvidos, revelar seus desejos e interferências nas operações de compra e venda a que tinham de se submeter e, por fim, desvendar o papel que a cidade do Rio desempenhava em suas vidas. Recuperando aspectos da experiência dos escravos na Corte, seus modos de pensar e atuar sobre o mundo, Chalhoub afirma que as lutas entre diferentes visões de liberdade e cativeiro contribuíram para o processo que culminou com o fim da escravidão no Rio de Janeiro.', '2020-12-18 19:30:32', 1, '2f9666334b7156e8e99adbbe22755a8a', 'pt_BR'),
