(2182, 'Um jovem estudante universitário regressa à sua ilha-natal para participar no funeral de seu avô Mariano. Enquanto aguarda pela cerimónia é testemunha de estranhas visitações na forma de pessoas e de cartas que lhe chegam do outro lado do mundo. São revelações de um universo dominado por uma espiritualidade que ele vai reaprendendo. À medida que se apercebe desse universo frágil e ameaçado, redescobre uma outra história para a sua própria vida e para a da sua terra. A Pretexto do relato das extraordinárias peripécias que rodeiam o funeral, este novo romance de Mia Couto traduz, de uma forma a um tempo irónica e profundamente poética, a situação de conflito vivida por uma elite ambiciosa e culturalmente distanciada da maioria rural. Uma vez mais, a escrita de Mia Couto leva-nos para uma zona de fronteira entre diferentes racionalidades, onde perceções diversas do mundo se confrontam, dando conta do mosaico de culturas que é o seu país e das mudanças profundas que atravessam a sociedade moçambicana atual.', '2020-12-18 19:41:40', 1, 'db658d730f650e057a13c25468781c32', 'pt_BR'),
