(2203, 'A lei no 10.639 tornou obrigatório o ensino da história e cultura afro-brasileira nas escolas. Esse fato foi considerado um importante passo pelos movimentos de luta dos negros em todo o país. Guia esclarecedor e abrangente, pensado e elaborado de forma didática tanto para professores quanto para alunos, este livro vem preencher justamente essa lacuna. Com linguagem fácil, o que propicia uma leitura fluente, a obra mostra que, apesar dos obstáculos impostos pela escravidão no Brasil, os africanos e seus descendentes encontraram meios para se organizar e manifestar suas culturas e, assim, influenciaram profundamente a sociedade brasileira como um todo. Livro indicado para alunos e professores.', '2020-12-18 19:59:14', 1, '75fcf98b15ccb5a0a2b3e01ec4d2624c', 'pt_BR'),
