(2216, 'Num pensionato de freiras paulistano, em 1973, três jovens universitárias começam sua vida adulta de maneiras bem diversas. A burguesa Lorena, filha de família quatrocentona, nutre veleidades artísticas e literárias. Namora um homem casado, mas permanece virgem. A drogada Ana Clara, linda como uma modelo, divide-se entre o noivo rico e o amante traficante. Lia, por fim, milita num grupo da esquerda armada e sofre pelo namorado preso. As meninas colhe essas três criaturas em pleno movimento, num momento de impasse em suas vidas. Transitando com notável desenvoltura da primeira pessoa narrativa para a terceira, assumindo ora o ponto de vista de uma ora de outra das protagonistas, Lygia Fagundes Telles constrói um romance pulsante e polifônico, que capta como poucos o espírito daquela época conturbada e de vertiginosas transformações, sobretudo comportamentais. Obra de grande coragem na época de seu lançamento (1973), por descrever uma sessão de tortura numa época em que o assunto era rigorosamente proibido, As meninas acabou por se tornar, ao longo do tempo, um dos livros mais aplaudidos pela crítica e também um dos mais populares entre os leitores da autora. \"Que beleza, que força, que matéria viva e lancinante em As meninas.\" - Carlos Drummond de Andrade \"Lygia Fagundes Telles tem realmente algo da delicadeza atmosférica de uma Katherine Mansfield. A diferença é apenas a seguinte: ela também sabe escrever romance e As meninas é mesmo um romance de alta categoria.\" - Otto Maria Carpeaux Leitura obrigatória do vestibular da UFRGS.', '2021-01-22 18:41:36', 1, '3f171a551b337a4f4b2c92a2aba7e688', 'pt_BR'),
