(2256, 'Protagonista e narradora de ´Hibisco roxo´, a adolescente Kambili mostra como a religiosidade extremamente ´branca´ e católica de seu pai, Eugene, famoso industrial nigeriano, inferniza e destrói lentamente a vida de toda a família. O pavor de Eugene às tradições primitivas do povo nigeriano é tamanho que ele chega a rejeitar o pai, contador de histórias, e a irmã, professora universitária esclarecida, temendo o inferno. Mas, apesar de sua clara violência e opressão, Eugene é benfeitor dos pobres e, estranhamente, apoia o jornal mais progressista do país. Durante uma temporada na casa de sua tia, Kambili acaba se apaixonando por um padre que é obrigado a deixar a Nigéria, por falta de segurança e de perspectiva de futuro.', '2021-01-29 18:30:47', 1, 'e9b87adfdeff2f4b6bb63d0bbc472c1f', 'pt_BR'),
