(2271, 'Não é só Sororidade, é Dororidade, diz-nos Vilma Piedade. Aqui, ela luta com palavras: o que é, afinal, Dororidade? O que este conceito aprofunda no diálogo feminista? Vilma Piedade desenvolve, com sua força, com sua militância e com seu estilo autêntico, legítimo Pretoguês, um conceito que nasceu de sua intuição e se espalhou amplamente, tornando-se necessário. Será possível construir o Feminismo Interseccional Inclusivo? Não sem todos os tons de Pretas. Não sem compreender o que é Dororidade.', '2021-01-29 18:46:32', 1, '7c3ef8a8679c7595301396149da7038c', 'pt_BR'),
