(2299, 'Série de entrevistas feitas por Celso Athayde e MV Bill com mulheres que trabalham para o tráfico de drogas. Este livro foi escrito a partir do sucesso de Falcão - Meninos do Tráfico, no qual os mesmos autores expuseram a vida dos garotos envolvidos com o narcotráfico nos morros de todo Brasil. Falcão - Mulheres e o Tráfico desnuda este universo sombrio de forma franca e objetiva, com uma narrativa arrepiante e contundente.', '2021-01-29 19:04:50', 1, '7579a6a94743c0a5d2a674a3fca31b5c', 'pt_BR'),
